import { Link } from "react-router-dom";

const links = [
  {
    title: "Home",
    link: "/"
  },
  {
    title: "About",
    link: "/about"
  },
  {
    title: "Products",
    link: "/products"
  }
  //   add the other link as well
];
export const Navbar = () => { 
  return
  {

    links.map((e) => 
    <>
      <Link to = {e.link}>{e.title}</Link>
      </>
    )
    //map through the link ad display it in header

  };

};
